frontApp.controller("childCategoryProductController",["$scope","$http","$window","CategoryProduct",function(n,t,i,r){n.categories=[];n.products=[];n.idCategory=angular.element("#idCategory").val();n.Posts=[];t.get("/API/CategoryProductsAPI/").success(function(t){var i=r.getallCategory(t);angular.forEach(i,function(t){t.idCategoryParent==n.idCategory&&n.categories.push(t)})});t.get("/API/ProductsAPI/").success(function(t){angular.forEach(t,function(t){t.idCategoryProduct==n.idCategory&&n.products.push(t)})});t.get("/admin/posts/GetByCategoryTour/"+n.idCategory).success(function(t){n.Posts=t})}]);